import NewsContent from '../components/News/NewsContent';
import { useEffect } from 'react';

function Home() {
  useEffect(()=>{
    window.scrollTo(0,0)
  })
  return (
    <div className="Home">
      <Header/>
      <NewsBanner/>
      <NewsContent/>
      <Newsletter/>
      <Footer/>
    </div>
  );
}

export default Home;
